import React, { useState, useEffect } from "react";

import CardMoreProjects from "./CardMoreProjects";
import MoreProjectsData from "./MoreProjectsData";
import "./MoreProjects.css";
import "../../App.css";
import axios from "axios";
//axios

const projects =
  "https://img.icons8.com/external-itim2101-lineal-color-itim2101/64/000000/external-clipboard-project-management-itim2101-lineal-color-itim2101.png";

const Resume = () => {
  const [project, setProject] = useState({
    project_name: "",
    project_link: "",
    year: "",
  });

  useEffect(() => {
    // fetchdata();
  }, []);
  const [projects, setProjects] = useState({
    project_name: "",
    project_link: "",
    year: "",
  });
  async function fetchdata() {
    console.log("hello");
    await axios
      .get("http://localhost:5000/projectsdataonly")
      .then((res) => {
        // console.log(res);
        const allData = res.data.result;
        setProjects(res.data.result);
        // console.log(allData);

        // const projectData = res.data.result;
      })
      .catch((err) => {
        console.log("hello error");
        console.log(err);
      });
    return projects;
  }
  const data = fetchdata();
  console.log(project);

  return (
    <>
      <section className="moreprojects" id="moreprojects">
        <div className="content-sectio d_flex moreProjects_box">
          <div className="heading">
            <img src={projects} alt="" />
            <h1>More Academic Projects</h1>
          </div>
          <div className="content">
            {project.map((val, index) => {
              return (
                <CardMoreProjects
                  key={index}
                  year={val.year}
                  title={val.project_name}
                  link={val.project_link}
                />
              );
            })}
          </div>
        </div>
      </section>
    </>
  );
};

export default Resume;
